// Import Expenses component

import Expenses from "./components/Expenses";

// holds function called App which is exported at the end
// we are returing html code inside js file which is due to JSX feature
// JSX stands for Javascript XML - this is the code which is transformed behind the scenes in react
function App() {
  const expenses = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      {}
      <Expenses expense={expenses}/>
    </div>
  );
}

export default App;

//We can make our components reusable by using parameters and a concept called props in React.
